INSERT INTO `jobinfos` (`id`, `employer_id`, `title`, `description`, `educational_level`, `program`, `work_experience_type`, `work_experience`, `location`, `job_type`, `salary`, `date_posted`, `benefits`, `responsibilities`, `qualifications`, `vacancy`, `company_name`, `company_logo`, `training_qualifications`, `from_date`, `to_date`, `created_at`, `updated_at`, `min_age`, `max_age`) VALUES
(66, 131, 'Customer Service Representatives', 'Customer Service Representatives assist customers with their concerns, offer details on the company’s products and services, handle returns, and more. Their primary responsibilities include addressing customer questions and complaints, processing orders, and directing complex issues to the appropriate teams.', NULL, NULL, NULL, NULL, 'Pasig, MM', 'Contractual', '20000', '2024-10-29', NULL, NULL, '• Preferably with Call Center SALES experience\r\n• If no CCE, must have sales background ONLY with the 3 industries (Car Sales/Realty/Insurance)\r\n• Average to good communication skills and good sounding voice\r\n• Advance computer skills and knowledgeable with MS office (Microsoft 365))\r\n• Fully Vaccinated', 4, 'Sterling Global', 'company_logo/1731147757.png', NULL, '2024-09-11', '2025-05-05', '2024-10-29 19:50:24', '2024-11-09 10:22:37', 20, 59),
(67, 135, 'Sales Promoter', 'A sales promoter is a skilled professional focused on raising product awareness by conducting demonstrations, handing out samples, delivering presentations, and generating public interest. They are responsible for fostering a positive brand image and developing creative marketing strategies.', 'Junior High School Graduate', NULL, NULL, NULL, 'Mandaluyong, MM', 'Contractual', '14000', '2024-10-29', NULL, NULL, '• With any sales experience\r\n• No visible tattoo\r\n• With TIN, SSS, PhilHealth, Pag-ibig & updated NBI\r\n• Fully Vaccinated', 15, 'CNT Promo and Ads Specialists, Inc', 'company_logo/1731148458.png', NULL, '2024-01-15', '2025-05-01', '2024-10-29 20:02:01', '2024-11-09 10:34:18', 18, 59),
(68, 135, 'Fashion Consultant', 'A fashion or image consultant is a professional stylist who guides clients in enhancing or building their personal or professional image through fashion and clothing choices. As style experts, they help clients select outfits and accessories for different occasions and events.', 'Junior High School Graduate', NULL, NULL, NULL, 'Mandaluyong, MM', 'Contractual', '13000', '2024-10-29', NULL, NULL, '• Female\r\n• With experience as Sales Promoter or Sales Associate\r\n• With TIN, SSS, PhilHealth, Pag-ibig & updated NBI\r\n• Fully Vaccinated', 5, 'CNT Promo and Ads Specialists, Inc', 'company_logo/1731148458.png', NULL, '2024-09-02', '2025-09-15', '2024-10-29 20:07:46', '2024-11-09 10:34:18', 18, 59),
(69, 135, 'Driver', 'A Delivery Driver is responsible for moving packages from a warehouse or packaging facility to both business and residential locations. Their tasks involve loading packages into their vehicle, using navigation tools to plan their route, and ensuring timely delivery to the correct addresses.', 'Bachelor\'s Degree', NULL, NULL, NULL, 'Mandaluyong, MM', 'Full-Time', '20000', '2024-10-29', NULL, NULL, '• 1,2,3, license restriction\r\n• With TIN, SSS, PhilHealth, Pag-ibig & updated NBI\r\n• Fully Vaccinated', 8, 'CNT Promo and Ads Specialists, Inc', 'company_logo/1731148458.png', NULL, '2024-09-01', '2025-03-03', '2024-10-29 20:11:47', '2024-11-09 12:47:17', 18, 55),
(70, 135, 'Kitchen Helper', 'Kitchen helpers handle a range of cleaning, maintenance, preparation, and stocking tasks in kitchens across restaurants, hospitals, schools, and nursing homes. Their responsibilities include washing dishes, assisting cooks with meal ingredient preparation, and keeping kitchens clean.', 'Junior High School Graduate', NULL, NULL, NULL, 'Mandaluyong, MM', 'Contractual', '15000', '2024-10-29', NULL, NULL, '• Male\r\n• With or without experience\r\n• With TIN, SSS, PhilHealth, Pag-ibig & updated NBI\r\n• Fully Vaccinated', 10, 'CNT Promo and Ads Specialists, Inc', 'company_logo/1731148458.png', NULL, '2024-10-07', '2024-12-02', '2024-10-29 20:14:34', '2024-11-09 10:34:18', 18, 55),
(71, 135, 'Production Helper', 'Production helpers support the production process in factories by moving carts and dollies with materials, unloading trucks and boxes, and placing items onto conveyor belts. They also assist with cleanup tasks.', 'Junior High School Graduate', NULL, NULL, NULL, 'Mandaluyong, MM', 'Contractual', '14000', '2024-10-29', NULL, '• Start up and stop equipment\r\n• Assist with production line in factories\r\n• Clean product area\r\n• Sweep\r\n• mop', NULL, 10, 'CNT Promo and Ads Specialists, Inc', 'company_logo/1731148458.png', NULL, '2024-05-06', '2024-11-11', '2024-10-29 20:20:39', '2024-11-09 10:34:18', 18, 50),
(72, 135, 'Merchandiser', 'A Merchandiser is a specialist responsible for overseeing inventory levels, arranging product displays in retail stores, and submitting reports to the warehouse for approval.', 'Bachelor\'s Degree', NULL, NULL, NULL, 'Mandaluyong, MM', 'Contractual', '15000', '2024-10-29', NULL, NULL, '• Male\r\n• With or without experience\r\n• With TIN, SSS, PhilHealth, Pag-ibig & updated NBI', 10, 'CNT Promo and Ads Specialists, Inc', 'company_logo/1731148458.png', NULL, '2024-08-05', '2024-11-11', '2024-10-29 20:24:29', '2024-11-09 10:34:18', 18, 45),
(73, 136, 'Promodiser', 'A Promodiser is responsible for selling products, addressing customer complaints, and promoting product features through demonstrations and explanations. They ensure products are properly displayed and replenished as needed, and they keep promotional items up to date and organized. Additionally, they maintain the cleanliness and orderliness of products both in the sales area and the stockroom.', NULL, NULL, NULL, NULL, 'Mandaluyong, MM', 'Contractual', '12500', '2024-10-29', NULL, NULL, '• At least with Government Numbers like SSS, Phil health, Pag-ibig, TIN', 10, 'Dames International Corp.', 'company_logo/1731148768.jpg', NULL, '2024-10-01', '2024-11-06', '2024-10-29 20:30:13', '2024-11-09 10:39:28', 18, 59),
(74, 136, 'Welder', 'A Welder is a skilled professional who assembles metal pieces or repairs damaged components by using high-heat machinery to melt and shape the metals.', 'Junior High School Graduate', NULL, NULL, NULL, 'Mandaluyong, MM', 'Part-Time', '15555', '2024-10-29', NULL, NULL, '• At least with Government Numbers like SSS, Phil health, Pag-ibig, TIN', 2, 'Dames International Corp.', 'company_logo/1731148768.jpg', NULL, '2024-09-16', '2024-11-18', '2024-10-29 20:33:13', '2024-11-09 10:39:28', 20, 50),
(75, 137, 'Audit Officer', 'An Auditor is a financial expert who conducts audits on company and organization financial accounts to verify the accuracy and integrity of their financial data. Responsibilities include reviewing financial statements for compliance with legal standards, preparing tax returns, and analyzing account books and accounting systems to ensure accuracy and operational efficiency for corporations.', 'Bachelor\'s Degree', NULL, NULL, NULL, 'Mandaluyong, MM', 'Full-Time', '35000', '2024-10-29', NULL, NULL, '• At least 1 year(s) of working experience\r\n• Familiar with internal controls procedures\r\n• Familiar with various audit techniques and procedures\r\n• MS Application proficient', 5, 'GOLDILOCKS BAKESHOP INC.', 'company_logo/1731149940.png', NULL, '2024-03-04', '2024-11-18', '2024-10-29 20:56:11', '2024-11-09 10:59:00', 30, 55),
(76, 137, 'Accounting Clerk', 'Accounting clerks provide essential services to their clients. Discover the roles of accounting clerks, the job requirements, and the skills needed for the position.', 'Bachelor\'s Degree', NULL, NULL, NULL, 'Mandaluyong, MM', 'Full-Time', '19000', '2024-10-29', NULL, NULL, '• Graduate of BS Accountancy, Financial Management, or any Accounting related course\r\n• Proficient in Microsoft Office Application\r\n• With knowledge in Accounting System\r\n• Amendable to work in Mandaluyong City', 10, 'GOLDILOCKS BAKESHOP INC.', 'company_logo/1731149940.png', NULL, '2024-08-17', '2024-11-25', '2024-10-29 21:10:51', '2024-11-09 10:59:00', 25, 53),
