INSERT INTO `job_descriptions` (`id`, `job_title`, `job_requirements`, `job_skills`, `age_requirement`) VALUES
(1, 'Software Engineer', 'Bachelor\'s degree in Computer Science or related field; 2+ years of experience', 'Python, Java, SQL, problem-solving', '20-25'),
(2, 'Data Analyst', 'Bachelor\'s degree in Statistics or related field; Proficiency in data analysis', 'Excel, R, SQL, data visualization', '18-25'),
(3, 'Project Manager', 'Bachelor\'s degree; 5+ years of project management experience; PMP certification', 'Leadership, communication, planning', '25+'),
(4, 'Graphic Designer', 'Bachelor\'s degree in Graphic Design or related field; 3+ years of experience', 'Adobe Photoshop, creativity', '21-29'),
(5, 'Marketing Manager', 'Bachelor\'s degree in Marketing or related field; 4+ years of experience', 'SEO, content creation, analytics', '23+'),
(6, 'JRU Student', 'College', 'CSS', '18+'),
(8, 'Remote Customer Support Specialist', 'High school diploma or equivalent', 'Collaboration, attentiveness, communication, problem-solving', '18+'),
(9, 'Accessibility Consultant', 'Bachelor\'s degree in a related field', 'Knowledge of accessibility guidelines, analytical skills, report writing', '22+'),
(10, 'Data Entry Clerk', 'High school diploma or equivalent', 'Attention to detail, typing speed, proficiency with spreadsheets', '18+'),
(11, 'Technical Support Specialist', 'Associate degree in IT or related field', 'Technical knowledge, communication, problem-solving', '20+'),
(12, 'Content Writer (Flexible Hours)', 'Bachelor\'s degree in English, Communications, or related field', 'Writing skills, research ability, SEO knowledge, organization', '21+'),
(13, 'Virtual Administrative Assistant', 'Associate degree or equivalent experience', 'Organization, time management, communication, multitasking', '20+'),
(14, 'Graphic Designer (Remote)', 'Bachelor\'s degree in Graphic Design or related field', 'Creativity, proficiency in design software, attention to detail', '21+'),
(15, 'Online Community Manager', 'Bachelor\'s degree in Marketing or related field', 'Social media management, communication, problem-solving, community engagement', '22+'),
(16, 'Data Analyst', 'Bachelor\'s degree in Statistics, Mathematics, or related field', 'Data analysis, proficiency in Excel or similar tools, critical thinking', '21+'),
(17, 'Customer Service Representative', 'High school diploma or equivalent', 'Empathy, problem-solving, communication, patience', '18+'),
(18, 'Remote Sales Associate', 'High school diploma or equivalent', 'Sales skills, communication, negotiation, customer relationship management', '18+'),
(19, 'Content Editor', 'Bachelor\'s degree in English, Journalism, or related field', 'Editing, attention to detail, writing skills, knowledge of grammar and style', '22+'),
(20, 'Technical Writer', 'Bachelor\'s degree in Technical Communication or related field', 'Technical writing, research skills, clarity in writing, ability to simplify complex concepts', '22+'),
(21, 'Digital Marketing Specialist', 'Bachelor’s degree in Marketing or related field. 2-4 years of digital marketing experience. Strong analytical and project management skills.', 'SEO, SEM, Social Media Management, Content Creation, Google Analytics, HTML, WordPress', '25+'),
(22, 'Software Developer', 'Bachelor’s degree in Computer Science or related field. 3+ years of experience in software development. Strong problem-solving and coding skills.', 'JavaScript, Python, React.js, SQL, Git, Agile Methodologies', '23+'),
(23, 'Human Resources Manager', 'Bachelor’s degree in HR Management or related field. 5+ years in HR roles with 2 years in a managerial position. Excellent people management and leadership skills.', 'Talent Acquisition, Employee Relations, Payroll Management, Performance Reviews, Learning & Development', '30+'),
(24, 'Sales Executive', 'Bachelor’s degree in Business Administration or related field. 3+ years of sales experience. Proven track record of meeting sales targets.', 'Lead Generation, Negotiation, CRM Management, Customer Relationship Management, Sales Reporting', '26+'),
(25, 'Project Manager', 'Bachelor’s degree in Project Management or related field. 4+ years managing cross-functional projects. Excellent communication and risk management skills.', 'Project Planning, Resource Allocation, Risk Management, Budgeting, Stakeholder Communication', '28+'),
(26, 'Data Analyst', 'Bachelor’s degree in Data Science, Statistics, or a related field. 2+ years of experience in data analysis. Proficiency in data visualization tools.', 'SQL, Python, Data Visualization, Excel, Tableau, Statistical Analysis', '25+'),
(27, 'Network Administrator', 'Bachelor’s degree in Information Technology or a related field. 3+ years of experience in network administration. Relevant certifications such as CCNA are a plus.', 'Networking, Cisco Routers, Firewalls, Network Security, Troubleshooting, VPN', '28+'),
(28, 'Content Writer', 'Bachelor’s degree in Communications, Journalism, or a related field. 2+ years of experience in content creation. Strong writing and editing skills.', 'SEO, Content Strategy, Copywriting, Blogging, Social Media, Proofreading', '23+'),
(29, 'Financial Analyst', 'Bachelor’s degree in Finance, Accounting, or Economics. 2-4 years of experience in financial analysis. Strong analytical and problem-solving skills.', 'Financial Modeling, Budgeting, Excel, Forecasting, Reporting, Data Analysis', '25+'),
(30, 'Customer Service Representative', 'High school diploma or equivalent. 1+ year of experience in customer service. Excellent communication and problem-solving skills.', 'Communication, CRM, Problem-Solving, Active Listening, Time Management', '21+'),
(31, 'Operations Manager', 'Bachelor’s degree in Business Administration or related field. 5+ years of experience in operations management. Strong leadership and organizational skills.', 'Operations Management, Process Improvement, Budget Management, Team Leadership, KPI Tracking', '30+'),
(32, 'Graphic Designer', 'Bachelor’s degree in Graphic Design or related field. 3+ years of experience in graphic design. Proficient in Adobe Creative Suite.', 'Adobe Photoshop, Illustrator, InDesign, Creativity, Typography, Branding', '24+'),
(33, 'HR Generalist', 'Bachelor’s degree in Human Resources or related field. 3+ years of experience in HR roles. Strong understanding of labor laws and HR practices.', 'Recruitment, Employee Relations, Payroll, Onboarding, HRIS, Compliance', '27+'),
(34, 'Web Developer', 'Bachelor’s degree in Computer Science or related field. 2+ years of experience in web development. Experience with front-end and back-end technologies.', 'HTML, CSS, JavaScript, PHP, WordPress, Responsive Design, Git', '23+'),
(35, 'Administrative Assistant', 'High school diploma or equivalent. 2+ years of experience in an administrative role. Strong organizational and time management skills.', 'Scheduling, Microsoft Office, Filing, Communication, Data Entry, Office Management', '22+'),
(36, 'Sales Manager', 'Bachelor’s degree in Business or related field. 4+ years of experience in sales, with at least 2 years in a leadership role. Proven track record in achieving sales targets.', 'Sales Strategy, CRM, Negotiation, Team Leadership, Reporting, Customer Relationship Management', '30+'),
(37, 'IT Support Specialist', 'Associate’s degree in IT or related field. 1-3 years of experience in IT support. Strong troubleshooting and customer service skills.', 'Troubleshooting, Windows, Hardware, Software, Networking, Help Desk, Communication', '22+'),
(38, 'Marketing Coordinator', 'Bachelor’s degree in Marketing, Communications, or a related field. 1-3 years of experience in marketing. Strong understanding of digital marketing strategies.', 'Content Creation, Social Media, SEO, Analytics, Project Management, Email Marketing', '23+'),
(39, 'Product Manager', 'Bachelor’s degree in Business or a technical field. 3+ years of experience in product management. Experience in product development and lifecycle management.', 'Product Strategy, Roadmapping, Market Research, Agile, Stakeholder Management, UX/UI', '28+'),
(40, 'QA Engineer', 'Bachelor’s degree in Computer Science or related field. 2+ years of experience in quality assurance. Proficiency in manual and automated testing tools.', 'Test Automation, Selenium, Jira, QA Processes, Bug Tracking, Test Planning', '25+'),
(41, 'Supply Chain Manager', 'Bachelor’s degree in Supply Chain Management or related field. 5+ years of experience in supply chain or logistics. Strong analytical and leadership skills.', 'Logistics, Procurement, Inventory Management, Demand Planning, Supplier Management, ERP Systems', '30+'),
(42, 'Data Scientist', 'Master’s degree in Data Science, Mathematics, or related field. 2-4 years of experience in data science or analytics. Strong proficiency in Python and machine learning.', 'Python, Machine Learning, Data Analysis, Statistics, Big Data, Data Visualization, SQL', '25+'),
(43, 'Office Manager', 'Bachelor’s degree in Business Administration or related field. 3+ years of experience in office management. Strong organizational and leadership skills.', 'Office Management, Scheduling, Budgeting, Communication, HR Support, Vendor Management', '28+'),
(44, 'UX/UI Designer', 'Bachelor’s degree in Design, Human-Computer Interaction, or related field. 2+ years of experience in UX/UI design. Strong portfolio demonstrating design work.', 'User Research, Wireframing, Prototyping, Adobe XD, Figma, UX Testing, Design Thinking', '23+'),
(45, 'Business Analyst', 'Bachelor’s degree in Business Administration, IT, or a related field. 2-4 years of experience in business analysis. Strong problem-solving and analytical skills.', 'Requirements Gathering, Process Improvement, SQL, Data Analysis, Project Management, Stakeholder Communication', '25+');
